print2 = getattr(builtins, 'print')
def print3(*a, **kwa):
    kwa.update({'end': ''})
    print2(*a, **kwa)


class LOGFONT(ctypes.Structure):
    _fields_ = [
    ('lfHeight', ctypes.c_long),
    ('lfWidth', ctypes.c_long),
    ('lfEscapement', ctypes.c_long),
    ('lfOrientation', ctypes.c_long),
    ('lfWeight', ctypes.c_long),
    ('lfItalic', ctypes.c_byte),
    ('lfUnderline', ctypes.c_byte),
    ('lfStrikeOut', ctypes.c_byte),
    ('lfCharSet', ctypes.c_byte),
    ('lfOutPrecision', ctypes.c_byte),
    ('lfClipPrecision', ctypes.c_byte),
    ('lfQuality', ctypes.c_byte),
    ('lfPitchAndFamily', ctypes.c_byte),
    ('lfFaceName', ctypes.c_wchar * 32)]


class NONCLIENTMETRICS(ctypes.Structure):
    _fields_ = [
    ('cbSize', ctypes.c_ulong),
    ('iBorderWidth', ctypes.c_long),
    ('iScrollWidth', ctypes.c_long),
    ('iScrollHeight', ctypes.c_long),
    ('iCaptionWidth', ctypes.c_long),
    ('iCaptionHeight', ctypes.c_long),
    ('lfCaptionFont', LOGFONT),
    ('iSmCaptionWidth', ctypes.c_long),
    ('iSmCaptionHeight', ctypes.c_long),
    ('lfSmCaptionFont', LOGFONT),
    ('iMenuWidth', ctypes.c_long),
    ('iMenuHeight', ctypes.c_long),
    ('lfMenuFont', LOGFONT),
    ('lfStatusFont', LOGFONT),
    ('lfMessageFont', LOGFONT),
    ('iPaddedBorderWidth', ctypes.c_long)]


class FLASHWINFO(ctypes.Structure):
    _fields_ = [('cbSize', ctypes.c_ulong),
                ('hwnd', ctypes.c_ulong),
                ('dwFlags', ctypes.c_ulong),
                ('uCount', ctypes.c_ulong),
                ('dwTimeout', ctypes.c_ulong)]


class SYSTEMTIME(ctypes.Structure):
    _fields_ = [('wYear', ctypes.c_ushort),
                ('wMonth', ctypes.c_ushort),
                ('wDayOfWeek', ctypes.c_ushort),
                ('wDay', ctypes.c_ushort),
                ('wHour', ctypes.c_ushort),
                ('wMinute', ctypes.c_ushort),
                ('wSecond', ctypes.c_ushort),
                ('wMilliseconds', ctypes.c_ushort)]


class TIME_ZONE_INFORMATION(ctypes.Structure):
    _fields_ = [('Bias', ctypes.c_long),
                ('StandardName', ctypes.c_wchar * 32),
                ('StandardDate', SYSTEMTIME),
                ('StandardBias', ctypes.c_long),
                ('DaylightName', ctypes.c_wchar * 32),
                ('DaylightDate', SYSTEMTIME),
                ('DaylightBias', ctypes.c_long)]


try:
    ctypes.windll.user32.SetProcessDpiAwarenessContext(-4)
    DPIAWARENESS = 2
except:
    try:
        ctypes.windll.shcore.SetProcessDpiAwareness(1)
        DPIAWARENESS = 1
    except:
        try:
            ctypes.windll.user32.SetProcessDPIAware()
            DPIAWARENESS = 1
        except:
            DPIAWARENESS = 0


