try:
    rootdir = nt.getcwd().split('\\')[0] + '\\'
except: rootdir = nt.getcwd()


def run(command, print_msg=True, errorinoutput=True, wait=True, call=False, delete_r=True):
    subprocess_Popen = subprocess.Popen
    subprocess_call = subprocess.call
    PIPE = subprocess.PIPE
    if call:
        print_msg = False
        errorinoutput = False
        delete_r = False
    if not wait:
        errorinoutput = False
        PIPE = None
    if errorinoutput:
        STDOUT = subprocess.STDOUT
    else:
        STDOUT = subprocess.PIPE
    if not wait:
        p = subprocess_Popen(command, shell=True, stdout=PIPE, stderr=STDOUT, cwd=rootdir)
        return
    if call:
        code = subprocess_call(command, shell=True, stdout=PIPE, stderr=STDOUT, cwd=rootdir)
        return code
    else:
        p = subprocess_Popen(command, shell=True, stdout=PIPE, stderr=STDOUT, bufsize=-1, cwd=rootdir)
        p = io.TextIOWrapper(io.BufferedReader(io.BytesIO(p.stdout.read())), encoding='mbcs')
        text = p.read()
        p.close()
        if print_msg:
            try:
                print2(text)
            except:
                pass
        if delete_r:
            text = text.replace('\r', '')
        return text


def isfile(_file):
    try:
        st = nt.stat(_file)
    except Exception:
        return False
    if st.st_mode & 0xf000 == 0x8000:
        return True
    else:
        return False


