def replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble(s):
    pattern = r'(\\*)(?=")'
    def replacement(match):
        backslashes = match.group(1)
        n = len(backslashes)
        return '\\' * (2 * n)
    result = re.sub(pattern, replacement, s)
    return result


def splitCommand(command):
    CommandLineToArgvW = ctypes.windll.shell32.CommandLineToArgvW
    CommandLineToArgvW.restype = ctypes.POINTER(ctypes.c_wchar_p)
    lpCmdLine = ctypes.c_int()
    args = CommandLineToArgvW(u'' + command, ctypes.byref(lpCmdLine))
    res = args[:lpCmdLine.value]
    LocalFree = ctypes.windll.kernel32.LocalFree
    LocalFree.argtypes = [ctypes.c_void_p]
    LocalFree.restype = ctypes.c_void_p
    LocalFree(args)
    return res


def getOldPipCommand(args=''): return '"import sys; import pip; sys.exit(pip.main([\'%s\']))"' % '\', \''.join([replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble(i).replace('\\', '\\\\').replace('"', '\\"').replace('\'', '\\\'') for i in splitCommand('pip ' + args)[1:]])


def getSaferCommand(args=''): return ' '.join([re.sub('(?<!^)"(?!$)', '\\"', replaceBackslashesInFrontOfDoubleQuotationMarksWithDouble('"%s"' % i)) for i in splitCommand('pip ' + args)[1:]])


