def qtupdatepythoninregistry(signal):
    global pythoninregistry, pythonpathinregistry
    pythoninregistry, pythonpathinregistry, pythonexepathinregistry = checkpythoninregistry()
    if [window.selectPython_comboBox.itemText(i) for i in range(window.selectPython_comboBox.count())] != pythoninregistry:
        if window.pythonPath[:-10:] not in pythonpathinregistry:
            window.pythonPath = ''
            window.pythonVersion = (0, 0)
            window.pipInstalled = False
            signal.emit([window.switchPageTo, [0]])
        signal.emit([window.selectPython_comboBox.clear, []])
        signal.emit([window.selectPython_comboBox.addItems, [pythoninregistry]])
        signal.emit([window.selectPython_lineEdit.setText, [pythonpathinregistry[0]]])
        signal.emit([window.selectPython_lineEdit.setCursorPosition, [0]])
        if len(pythoninregistry) > 1: signal.emit([window.selectPython_lineEdit.setReadOnly, [True]])
