def gethwnd(window):
    hwnd = window.winId()
    if type(hwnd) != int:
        try:
            f = ctypes.pythonapi.PyCapsule_GetPointer
            f.restype, f.argtypes = ctypes.c_void_p, [ctypes.py_object, ctypes.c_char_p]
            hwnd = f(hwnd, None)
        except:
            f = ctypes.pythonapi.PyCObject_AsVoidPtr
            f.restype, f.argtypes = ctypes.c_void_p, [ctypes.py_object]
            hwnd = f(hwnd)
    return hwnd


def gettimezone():
    try:
        tzinfo = TIME_ZONE_INFORMATION()
        ctypes.windll.kernel32.GetTimeZoneInformation(ctypes.byref(tzinfo))
        timezone = float(-tzinfo.Bias) / 60.0
    except:
        timezone = 0.0
    return timezone


def getcurrenttime():
    currenttimecode = time.time() + (3600.0 * gettimezone())
    currentsec = str(int(currenttimecode % 60.0))
    currentminute = str(int((currenttimecode % 3600.0) / 60.0))
    currenthour = str(int((currenttimecode % 86400.0) / 3600.0))
    if len(currentsec) < 2:
        currentsec = '0' + currentsec
    if len(currentminute) < 2:
        currentminute = '0' + currentminute
    if len(currenthour) < 2:
        currenthour = '0' + currenthour
    return [currenthour, currentminute, currentsec]


