class ColourfulProgressBar(QProgressBar):
    def __init__(self, *a, **kwa):
        super(ColourfulProgressBar, self).__init__(*a, **kwa)
        self.qss = '''QProgressBar{border-width: 0px; border-style: none; background: transparent; color: %s}
QProgressBar::chunk{background: rgb(%d, %d, %d)}'''
        self.__textclr = '#000000'
        self.setStyleSheet(self.qss % (self.__textclr, 127, 127, 127))
        self.a1, self.b1, self.c1, self.a2, self.b2, self.c2 = [random.randint(0, 255) for i in range(6)]
        self.state = 1
        self.mincv = 0
        self.maxcv = 255
    def setMinimumColourValue(self, n):
        self.mincv = n
        self.a1, self.b1, self.c1, self.a2, self.b2, self.c2 = [random.randint(self.mincv, self.maxcv) for i in range(6)]
    def setMaximumColourValue(self, n):
        self.maxcv = n
        self.a1, self.b1, self.c1, self.a2, self.b2, self.c2 = [random.randint(self.mincv, self.maxcv) for i in range(6)]
    def setTextColour(self, s):
        self.__textclr = s
        self.setStyleSheet(self.qss % (self.__textclr, 127, 127, 127))
    def paintEvent(self, event):
        if self.value() != 0:
            f1 = lambda a, b, c: int(a - abs(a - b) * c if a > b else a + abs(b - a) * c)
            f2 = lambda a1, b1, c1, a2, b2, c2, d: (f1(a1, a2, d), f1(b1, b2, d), f1(c1, c2, d))
            if time.time() % 1.5 < 0.75:
                if self.state != 1:
                    self.state = 1
                    self.a1, self.b1, self.c1 = [random.randint(self.mincv, self.maxcv) for i in range(3)]
                self.setStyleSheet(self.qss % ((self.__textclr,) + f2(self.a2, self.b2, self.c2, self.a1, self.b1, self.c1, (time.time() % 1.5) / 0.75)))
            else:
                if self.state != 2:
                    self.state = 2
                    self.a2, self.b2, self.c2 = [random.randint(self.mincv, self.maxcv) for i in range(3)]
                self.setStyleSheet(self.qss % ((self.__textclr,) + f2(self.a1, self.b1, self.c1, self.a2, self.b2, self.c2, ((time.time() % 1.5) - 0.75) / 0.75)))
        return super(ColourfulProgressBar, self).paintEvent(event)


