class TextBrowser(QTextBrowser):
    def __init__(self, *a):
        super(TextBrowser, self).__init__(*a)
        self.setSizePolicy(QSizePolicy(QSizePolicy.Expanding, QSizePolicy.Expanding))
        self.textChanged.connect(self.adjustHeightByTextLength)
        self.state = 1
        self.setContextMenuPolicy(Qt.CustomContextMenu)
        self.customContextMenuRequested.connect(self.showContextMenu)
        self.contextMenu = Menu(self)
        self.shadow1 = QGraphicsDropShadowEffect(self.contextMenu)
        self.shadow1.setOffset(0, 0)
        self.contextMenu.setGraphicsEffect(self.shadow1)
        self.lastparentsize = self.parentWidget().size()
    def resetCMActions(self):
        self.contextMenu.clear()
        if self.textCursor().selectedText() != '':
            self.__action1 = self.contextMenu.addAction(copytext)
            self.__action1.triggered.connect(self.copy)
        if self.toPlainText() != '':
            self.__action2 = self.contextMenu.addAction(selectalltext)
            self.__action2.triggered.connect(self.selectAll)
    def showContextMenu(self, pos):
        self.resetCMActions()
        cursorpos = QCursor().pos()
        self.contextMenu.move(cursorpos.x() + 1, cursorpos.y() + 1)
        self.contextMenu.show()
    def adjustHeightByTextLength(self, fromresizeevent=True):
        lastparentsize = self.parentWidget().height()
        if fromresizeevent or lastparentsize != self.lastparentsize:
            self.document().setTextWidth(self.width() - self.verticalScrollBar().width())
            if self.height() != 0 and self.document().size().height() != 0 and self.state:
                self.state = 0
                self.setMinimumHeight(0)
                self.setMaximumHeight(16777215)
                self.setSizePolicy(QSizePolicy(QSizePolicy.Expanding, QSizePolicy.Expanding))
                if self.height() > self.document().size().height():
                    self.setSizePolicy(QSizePolicy(QSizePolicy.Expanding, QSizePolicy.Fixed))
                    self.setMinimumHeight(self.document().size().height())
                    self.setMaximumHeight(self.document().size().height())
                if self.height() < self.document().size().height():
                    self.document().setTextWidth(self.width() - self.verticalScrollBar().width())
                    self.document().adjustSize()
                self.state = 1
        self.lastparentsize = lastparentsize
    def resizeEvent(self, event):
        self.adjustHeightByTextLength()
    def paintEvent(self, event):
        self.adjustHeightByTextLength(False)
        return super(TextBrowser, self).paintEvent(event)


