    def flashSelectedMenuButton(self, button, showanimation=False):
        self.selectedMenuButton = button
        self.flashSelectedMenuButtonStyle(showanimation)
    def closeEvent(self, event):
        event.accept()
        deletegetpipyzrpytempfile()
    def eventFilter(self, watched, event):
        if event.type() in [QEvent.KeyPress, QEvent.ShortcutOverride]:
            if event.key() in [Qt.Key_Tab, Qt.Key_Up, Qt.Key_Down, Qt.Key_Left, Qt.Key_Right]:
                if not self.keyfocus:
                    self.keyfocus = True
                    self.setWidgetsSize()
        return 0
    def flashSelectedMenuButtonStyle(self, showanimation=False):
        dpi = self.dpi()
        f1 = lambda n: int(n * dpi / 96.0)
        isdark = self.isDarkTheme()
        button = self.selectedMenuButton
        label = self.selectedMenuButtonLabel
        label.setStyleSheet('QLabel{background: %s; border-radius: %d}' % ('#E6AAFF' if isdark else '#8E00CC', f1(4) // 2))
        rect1 = QRect(button.x(), button.y() + button.height() * 0.4 // 2, f1(4), button.height() * 0.6)
        rect2 = QRect(button.x(), min(button.y() + button.height() * 0.4 // 2, label.y()), f1(4), abs(button.y() + button.height() * 0.4 // 2 - label.y()) + button.height() * 0.6)
        if showanimation:
            label.timer.timeout.connect(lambda: (label.animation.setStartValue(rect2), label.animation.setEndValue(rect1), label.animation.start(), label.timer.stop()))
            label.animation.setStartValue(label.geometry())
            label.animation.setEndValue(rect2)
            label.animation.start()
            label.timer.start(250)
        else: label.setGeometry(button.x(), button.y() + button.height() * 0.4 // 2, f1(4), button.height() * 0.6)
    def showEvent(self, event):
        self.setWidgetsSize()
    def MessageHandler(self, hwnd, message, wParam, lParam):
        WM_SETTINGCHANGE, WM_LBUTTONDOWN, WM_RBUTTONDOWN, WM_MBUTTONDOWN, WM_DPICHANGED = 0x1a, 0x201, 0x204, 0x207, 0x2e0
        SPI_SETNONCLIENTMETRICS = 0x2a
        if message == WM_SETTINGCHANGE:
            lParam_string = ctypes.c_wchar_p(lParam).value
            if lParam_string == 'ImmersiveColorSet':
                self.setWidgetsSize()
        if message in [WM_LBUTTONDOWN, WM_RBUTTONDOWN, WM_MBUTTONDOWN]:
            if self.keyfocus:
                self.keyfocus = False
                self.setWidgetsSize()
        if message == WM_DPICHANGED:
            self.setWidgetsSize()
        if message == WM_SETTINGCHANGE:
            if wParam == SPI_SETNONCLIENTMETRICS:
                self.defaultfont = getmessagefont()
                self.setWidgetsSize()
    def switchPageTo(self, value, withterminal=True):
        if value in [1, 2, 3] and self.pythonPath == '': return self.dialogue.showWarning(selecttheversionofpythonfirsttext, errortext)
        if value in [2, 3] and not self.pipInstalled: return self.dialogue.showWarning(installpipfirsttext, errortext)
        menubuttons = [self.MenuButton_selectPython, self.MenuButton_configurePip, self.MenuButton_manageModules, self.MenuButton_batchManage, self.MenuButton_aboutThisProgram]
        frames = [self.selectPython_Frame, self.configurePip_Frame, self.manageModules_Frame, self.batchManage_Frame, self.aboutThisProgram_Frame]
        mainlayouts = [self.selectPython_MainLayout, self.configurePip_MainLayout, self.manageModules_MainLayout, self.batchManage_MainLayout, self.aboutThisProgram_MainLayout]
        this_menubutton = menubuttons[value]
        this_frame = frames[value]
        this_mainlayout = mainlayouts[value]
        menuframe = self.menuFrame
        try:
            last_frame = self.BackgroundLayout.itemAt(1).widget()
            x1, y1, w1, h1 = last_frame.x(), last_frame.y(), last_frame.width(), last_frame.height()
            x2, y2, w2, h2 = menuframe.x(), menuframe.y(), menuframe.width(), menuframe.height()
            [(self.BackgroundLayout.removeWidget(i), i.hide()) for i in frames]
            self.BackgroundLayout.removeWidget(menuframe)
            menuframe.setGeometry(x2, y2, w2, h2)
            getattr(this_mainlayout, 'addWidget' if withterminal else 'removeWidget')(self.terminal)
            this_frame.show()
            this_frame.resize(w1, h1)
            this_frame.timer.timeout.connect(lambda: (self.BackgroundLayout.addWidget(menuframe), self.BackgroundLayout.addWidget(this_frame), this_frame.timer.stop()))
            this_frame.animation.setStartValue(QPoint(x1, (h1 // 8) + y1))
            this_frame.animation.setEndValue(QPoint(x1, y1))
            this_frame.animation.start()
            this_frame.timer.start(500)
            self.flashSelectedMenuButton(this_menubutton, True)
        except: pass
        for i in menubuttons: i.repaint()
